import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const b=JSON.parse('{"title":"七月十五","description":"","frontmatter":{"title":"七月十五","date":"2020-07-15T00:00:00.000Z","draft":false,"tags":[2020]},"headers":[],"relativePath":"note/2020/20200715.md"}'),n={name:"note/2020/20200715.md"},a=t("p",null,"七月十五，照例今天是要发工资的，但是和上个月一样，没有发，早有心理预期，还是有点失落。不过也没啥，迟早会发的，这样想着，先把自己手头的工作做了吧，今天就做了两件事情，一个是配置服务器防火墙策略，这个东西真是，很有趣，很灵活，在午饭之前搞定了，下午就是装zabbix，本来是准备写文档的，但是写到一半，发现很多地方下不下去，所以就先搁置了，换另一个工作去做，到下班前，其实已经安装好了，但是访问出来一点问题，暂时还不能用，肚子又饿的慌，直接装电脑回宿舍了，明天再弄。",-1),_=t("p",null,"周一到现在，三天，我感觉很微弱，因为没有什么心境起伏，更像是一个机器而已，硬要说有什么值得一提的，就是我准备写一个APP，用flutter来写，我看了一下，感觉这个东西很有前景，因为很符合开发APP的需求，入手曲线也比较平滑，以后应该会很有市场前景，我准备抽时间好好弄一下。",-1),c=t("p",null,"连续两天，我都是回来吃完东西，直接睡觉，最多就是看十几分钟的视频，然后一睁眼，又到了第二天，这种节奏，其实挺好的，就是起来以后，不会感觉身体那么类，睡眠很充分的感觉，就像是有种力量的堆叠一样，所以我今天也是准备保持这样的习惯，多保持几天，看看会有什么变化。",-1),l=t("p",null,"吃饭的时候，我们谈到现在的经理，感觉是一个不那么实际的人，我甚至定论，在他的领导下，咱们的项目应该是做不成，起码成功不了，所以我在想，也许可以考虑后路了，大概在几个月以后，就会出现崩盘的现象，当然这种情况最好还是不要出现，谁不想好好的发展呢？我们都感觉，缺了东西，而且缺的很多，所以做不成。",-1),r=t("p",null,"我自己的计划，是把原来的开发能力找回来，业余时间做点项目，以后留作面试用，至于去哪里，我现在也没有想好，也许我就真是五根的野草吧，飘到哪里，哪里都会荒芜。",-1),d=t("p",null,"另外，我必须对自己强调专注这件事情，因为下午我不是很专心，和网友一边聊天一边做事，可能也是这个原因导致效率不够，没有完成预期的目标，下次，我要提前预防这种行为。",-1),i=[a,_,c,l,r,d];function p(u,f,h,m,P,x){return s(),o("div",null,i)}const B=e(n,[["render",p]]);export{b as __pageData,B as default};
